import React ,{ useState } from  "react"
//import React {useEffect} from "react"
import "./UsingHook.css"

function UsingHook(){
   const [count,setCount]=useState(0)
   const [age,setAge]=useState(45)
   const [Name,setName]=useState("Mande")
   
 return(
<div>
    <button onClick={()=>setCount((count)=>count+1)}>Count:{count}</button>
    <button onClick={()=>setCount((count)=>count=0)}>Reset count</button>

    <input type="text" name="age" placeholder={age} onChange={e =>setName(e.target.value)}></input>
    <input type="text" name="name" placeholder={Name} ></input>

    <div>
        <h3>your Age:{}</h3>

    </div>



</div>



 )
}


export default UsingHook
